import React,{Component} from 'react';
import "./Home.css";

var token = localStorage.getItem('token');
var pp = localStorage.getItem('profilephoto');
  
class Home extends Component{
  constructor(props){
super(props)  
this.state={
products: [],
delsuccess:false
}
} 

  
  
  render(){
    

  return (
    <div className="container home" style={{marginBottom:"100px",border:"1px solid #84c225"}}>
        <div className="row">
            <div className="col-md-12 productbox"  style={{paddingTop:"10px",paddingBottom:"10px"}}>
             
             <div className=" p-3 " style={{borderRadius:"10px",boxShadow:"0 0 10px gray"}}>
              <div className="text-center mb-3" style={{borderRadius:"10px",boxShadow:"0 0 5px gray"}}>
                <img height={150} width={150} />
              </div>
              <div className="">
              <p style={{fontWeight:"bold"}}>CINTHOL -Cool soap</p>
              <p className="alert alert-secondary"></p>
              <div style={{display:"flex"}}>
              <p style={{marginRight:"5px"}}>Rs</p><p style={{fontWeight:"bold"}}>100</p> </div>
              </div>
              <div className="d-flex justify-content-center">
              <div className="text-center p-0" style={{display:"flex"}}>

              <input type="button" style={{padding:"0px 11px",borderRadius:"5px"}} className="btn-light text-danger" value="-" />

              <input type="text" step="1" min="1" max="" name="quantity" value="1" title="Qty"  className="bg-white text-center text-danger form-control" style={{width:"50px",border:"1px solid #ba5253"}} />

              <input type="button" style={{padding:"0px 10px",borderRadius:"5px"}} className="btn-light text-danger" value="+" />
              
              </div>
              </div>
              <div className="d-flex justify-content-center">
                 <input style={{border:"1px solid #ba5253",borderRadius:"2px",width:"100px"}} className="bg-danger mt-3 text-light" type="submit" value="Add" />
                
              </div>
             </div>

            
            </div>
        </div>   

    </div>
);
}
};


export default Home;
